import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { data } from 'jquery';
import { CommandeService } from '../commande.service';

@Component({
  selector: 'app-commandes',
  templateUrl: './commandes.component.html',
  styleUrls: ['./commandes.component.css']
})
export class CommandesComponent implements OnInit {

  constructor( private commandeService:CommandeService, private route:ActivatedRoute,) { }
  public commandes : any;
  public commande_id: any;

  async ngOnInit(): Promise<void> {
    this.commandes= await this.commandeService.getCommandes().then(data => {
      this.commandes = data
      return data});
    if (this.route.snapshot.paramMap.get('id')) {
      this.recherche(this.route.snapshot.paramMap.get('id'));
    }
  } 

  recherche(numCom:any) {
    this.commande_id = this.commandes.filter((res: { _id: string; }) => res._id.toLowerCase() === numCom.toLowerCase());
    console.log("la num commande",numCom);
    console.log("la recherche", this.commandes);
    console.log("la recherche_id", this.commandes);
  }

}
